import React from 'react'
import './main.css';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import {A1,A2,B1,B2} from './images';



function Levels() {
    return (
        <React.Fragment>
        <Row>
            <Col md='12' lg='3'>
                <img src={A1} alt="A1" />
            </Col>
            <Col md='12' lg='3'>
            <img src={A2} alt="A2" />
            </Col>
            <Col md='12' lg='3'>
            <img src={B1} alt="B1" />
            </Col>
            <Col md='12' lg='3'>
            <img src={B2} alt="B2" />
            </Col>
        </Row>
        </React.Fragment>
    )
}
export default Levels;
